import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import { AmplifyAuthenticator, AmplifySignIn, AmplifySignUp } from '@aws-amplify/ui-react';
import AnimationApp from './AnimationApp'; // Assume you have separated AnimationApp into a different file

function App() {
  return (
    <div className="App">
      <Router>
        <AmplifyAuthenticator>
          <AmplifySignIn headerText="My Custom Sign In Header" slot="sign-in" />
          <AmplifySignUp headerText="My Custom Sign Up Header" slot="sign-up" />
          <AnimationApp />
        </AmplifyAuthenticator>
      </Router>
    </div>
  );
}

export default App;
